import './App.css';
import {
  createBrowserRouter as Router,
  Routes,
} from "react-router";
import { Home } from './Components/Home';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={Home} />
      </Routes>
    </Router>
  );
}

export default App;
